const playIcon = ({ size }) => (
    <svg width="36" height="36" viewBox="0 0 36 36" xmlns="http://www.w3.org/2000/svg">
        <circle cx="18" cy="18" r="16.2" fill="white" stroke="white" stroke-width="1.8" />
        <polygon points="14.4,10.8 25.2,18 14.4,25.2" fill="rgb(31, 41, 55)" />
    </svg>
);

export default playIcon;
